import React from 'react'
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Link from '@mui/material/Link';
import Avatar from '@mui/material/Avatar';

//       flexGrow: 1 هتاخذمساحه كبيرة ناحية الشمال 

export default function Navbar() {


  return (
    <>
  <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>

        <Link href='/' color='inherit' sx={{flexGrow:1 , "&:hover" : {fontSize:"20px" , color:"white"  }}} underline="none"> My expenses </Link>
          <p color="inherit" className=' me-3 pt-2'>Mariam Mohamed</p>
      <Avatar alt="Mariam Mohamed" src="../../../images/unnamed.jpg"/>
        </Toolbar>
      </AppBar>
    </Box>

    
    
    
    
    </>
  )
}
